/* Procedure structure for procedure `func_time_calculate` */

/*!50003 DROP PROCEDURE IF EXISTS  `func_time_calculate` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `func_time_calculate`()
BEGIN
/*
CALL func_time_calculate();
*/
DECLARE p_fr_sl INT;
DECLARE p_to_sl INT;
SET p_fr_sl=1;
SET p_to_sl=3;
  WHILE  p_fr_sl <=  p_to_sl DO
    update time_calculate
    set remainingHour=(CASE WHEN p_fr_sl =1 then totalHour else (select remainingHour from (select * from time_calculate)a
    where slNo=p_fr_sl-1)end)
    -HOUR(TIMEDIFF(officeToTime,case when p_fr_sl =1 then ticketStartTime else officeFromTime end))
    WHERE slNo=p_fr_sl;
    set p_fr_sl=p_fr_sl+1;
  END WHILE;
  
  select * from time_calculate;
  
END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_string_break` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_string_break` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_string_break`(
/*
call proc_string_break('1000 to 5000,8000 to 10000,15000 to 20000','Bohemian,Exotic,Flamboyant')
*/
p_price VARCHAR(255),
p_category varchar(255)
)
BEGIN
DROP TABLE IF EXISTS str;
CREATE TABLE str
(
str VARCHAR(255)
);
INSERT str
SELECT p_price;
DROP TABLE IF EXISTS rang;
CREATE TABLE rang
(
id INT AUTO_INCREMENT,
str VARCHAR(100),
PRIMARY KEY (`id`)
);
INSERT rang(str)
SELECT 
TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(t.str, ',', n.n), ',', -1)) t
  FROM str t 
  CROSS JOIN 
(
   SELECT a.N + b.N * 10 + 1 n
     FROM 
    (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
   ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
    ORDER BY n
) n
 WHERE n.n <= 1 + (LENGTH(t.str) - LENGTH(REPLACE(t.str, ',', '')));
 
 
 
 SELECT t1.imageId, t1.userId, t1.imagePath, imageHeight, imageWidth, 
IFNULL((SELECT IF(productId, 'yes', 'no') FROM `tbl_product` WHERE imageId = `t1`.`imageId`), 'no') AS sales
FROM `tbl_images` AS t1
LEFT JOIN `tbl_product` t2 ON t1.imageId = t2.imageId
LEFT JOIN `tbl_user` t3 ON t1.userId = t3.userId
LEFT JOIN `tbl_category` t4 ON t4.categoryId = t3.category
WHERE t2.prodPrice BETWEEN (SELECT CAST(TRIM(IFNULL(SUBSTRING_INDEX(str,'to',1),''))AS DECIMAL(10,2)) AS part1 FROM rang WHERE id=1)
		AND  (SELECT CAST(TRIM(IFNULL(SUBSTRING_INDEX(SUBSTRING_INDEX(str,'to',2),'to',-1),''))AS DECIMAL(10,2)) AS part1 FROM rang WHERE id=1)
and FIND_IN_SET(t4.categoryName,p_category) 
UNION
SELECT t1.imageId, t1.userId, t1.imagePath, imageHeight, imageWidth, 
IFNULL((SELECT IF(productId, 'yes', 'no') FROM `tbl_product` WHERE imageId = `t1`.`imageId`), 'no') AS sales
FROM `tbl_images` AS t1
LEFT JOIN `tbl_product` t2 ON t1.imageId = t2.imageId
LEFT JOIN `tbl_user` t3 ON t1.userId = t3.userId
LEFT JOIN `tbl_category` t4 ON t4.categoryId = t3.category
WHERE prodPrice BETWEEN (SELECT CAST(TRIM(IFNULL(SUBSTRING_INDEX(str,'to',1),''))AS DECIMAL(10,2)) AS part1 FROM rang WHERE id=2)
		AND  (SELECT CAST(TRIM(IFNULL(SUBSTRING_INDEX(SUBSTRING_INDEX(str,'to',2),'to',-1),''))AS DECIMAL(10,2)) AS part1 FROM rang WHERE id=2)
AND FIND_IN_SET(t4.categoryName,p_category) 
UNION
SELECT t1.imageId, t1.userId, t1.imagePath, imageHeight, imageWidth, 
IFNULL((SELECT IF(productId, 'yes', 'no') FROM `tbl_product` WHERE imageId = `t1`.`imageId`), 'no') AS sales
FROM `tbl_images` AS t1
LEFT JOIN `tbl_product` t2 ON t1.imageId = t2.imageId
LEFT JOIN `tbl_user` t3 ON t1.userId = t3.userId
LEFT JOIN `tbl_category` t4 ON t4.categoryId = t3.category
WHERE prodPrice BETWEEN (SELECT CAST(TRIM(IFNULL(SUBSTRING_INDEX(str,'to',1),''))AS DECIMAL(10,2)) AS part1 FROM rang WHERE id=3)
		AND  (SELECT CAST(TRIM(IFNULL(SUBSTRING_INDEX(SUBSTRING_INDEX(str,'to',2),'to',-1),''))AS DECIMAL(10,2)) AS part1 FROM rang WHERE id=3)
AND FIND_IN_SET(t4.categoryName,p_category);
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_split` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_split` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `sp_split`(IN toSplit text, IN target varchar(255))
BEGIN
	# Temp table variables
	SET @tableName = 'tmpSplit';
	SET @fieldName = 'variable';
	# Dropping table
	SET @sql := CONCAT('DROP TABLE IF EXISTS ', @tableName);
	PREPARE stmt FROM @sql;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;
	# Creating table
	SET @sql := CONCAT('CREATE  TABLE ', @tableName, ' (', @fieldName, ' VARCHAR(1000))');
	PREPARE stmt FROM @sql;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;
	# Preparing toSplit
	SET @vars := toSplit;
	SET @vars := CONCAT("('", REPLACE(@vars, ",", "'),('"), "')");
	# Inserting values
	SET @sql := CONCAT('INSERT INTO ', @tableName, ' VALUES ', @vars);
	PREPARE stmt FROM @sql;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;
	# Returning record set, or inserting into optional target
	PREPARE stmt FROM @sql;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;
		
    END */$$
DELIMITER ;

